member.summary:
The BAD response indicates an error message from the server.  
When tagged, it reports a protocol-level error in the client's command; 
the tag indicates the command that caused the error.  
The untagged form indicates a protocol-level error for which the associated command can not be determined; 
it can also indicate an internal server failure.  
The human-readable text describes the condition.

SOCKS4 and SOCKS4a version 
SOCKS4a extends the SOCKS4 protocol to allow a client to specify a destination domain name rather than an IPv4 address; 
this is useful when the client itself cannot resolve the destination host's domain name to an IP address.

SOCKS5 version 
The SOCKS5 protocol is defined in RFC 1928. It is an extension of the SOCKS4 protocol; 
it offers more choices for authentication, and adds support for IPv6 and UDP, the latter of which can be used for DNS lookups.

member.returns:
true if item was successfully removed from the System.Collections.Generic.ICollection;
otherwise, false. This method also returns false if item is not found in the
original System.Collections.Generic.ICollection.

member.summary:
Any: this property type value matches any type; 
a server MUST return the actual type in its response. 
Servers MUST NOT return this type in response to a client request other than NspiGetIDsFromNames 
or the RopGetPropertyIdsFromNames ROP request ([MS-OXCROPS] section 2.2.8.1).
Specification name: PtypUnspecified; Alternate names: PT_UNSPECIFIED;

Gets or sets the telephone number 
for the contact's text telephone (TTY) 
or telecommunication device for the deaf (TDD)

example.code:
 //Open Outlook Message files
 MapiMessage msg = MapiMessage.FromFile(@"c:\outlookmessage.msg");

//read subject
Console.WriteLine("Subject:" + msg.Subject);

//sender name
Console.WriteLine("From:" + msg.SenderName);

//message body
Console.WriteLine("Body:" + msg.Body);

//Attachments
foreach(MapiAttachment att in msg.Attachments)
{
    Console.WriteLine("Attachment Name:"+att.FileName);
    att.Save(att.FileName);
}

//Remove attachments from Outlook Message files
MapiAttachmentCollection attachments = MapiMessage.RemoveAttachments(@"c:\outlookmessage.msg");

//Attachments
foreach(MapiAttachment att in attachments)
{
   Console.WriteLine("Attachment Name:"+att.FileName);
   att.Save(att.FileName);
}

